use reqwest;
use serde_json::json;

pub struct Client {
    pub credentials: Credentials,
}

impl Client {
    pub fn new(credentials: Credentials) -> Self {
        Client { credentials }
    }

    pub async fn get_text(&self, text: String) -> Result<String, reqwest::Error> {
        let url = "https://api.elevenlabs.io/v1/text";
        let headers = reqwest::header::HeaderMap::new();
        headers.insert("Authorization", format!("Bearer {}", self.credentials.api_key));
        headers.insert("Content-Type", "application/json");

        let json = json!({
            "text": text,
        });

        let response = reqwest::Client::new()
            .post(url)
            .headers(headers)
            .json(&json)
            .send()
            .await?;

        let response_text = response.text().await?;
        Ok(response_text)
    }
}
```

