```

### Solution

To achieve case-insensitive sorting in JavaScript, you can use the `localeCompare()` method or the `toLowerCase()`/`toUpperCase()` methods in conjunction with the `sort()` method.

#### Method 1: Using `localeCompare()`

```javascript
const strings = ["Apple", "banana", "Cherry", "date", "Elderberry"];

strings.sort((a, b) => a.localeCompare(b));

